import React, { Component } from 'react';
import './App.css';
import Card from './Card';

const style = {
  margin: auto,
  display: flex,
  flexDirection: column,
  alignItems: center,
  justifyContent: center,
}

class App extends Component {
  render() {
    let content = (
      <div style={style}>
        <p>Hi!</p>
      </div>
    )
    return (
      <div className="App">
        <Card content={content}/>
      </div>
    );
  }
}

export default App;
